import { ProgressBar } from 'react-bootstrap'

import { useState, usetate } from 'react'

const TaskTen = () => {
  const [progres, setProgres] = useState()
  const getValue = (e) => {
     setProgres(e.target.value) 
  }

  return (
    <>
    <div style= {{display:'flex'}}>
      <ProgressBar
        style={{
          width: '250px',
          marginTop: '100px',
          border: '1px solid black',
        }}
        now={progres}
      />
      <input style={{width:'20px',height:'20px'}} onChange ={getValue} value={progres}/>
      </div>
    </>
  )
}

export default TaskTen
